import React from "react";
import "./Result.css";
import Button from "../auxiliaries/button";
import { Switch, Route, withRouter, Link } from "react-router-dom";
import PositiveResult from "./PositiveResult.js";

class Result extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    const between = (min, max) => {
      return (
        this.props.currentTime >=
          this.props.targetCookingTime - min * this.props.targetCookingTime &&
        this.props.currentTime <=
          this.props.targetCookingTime + max * this.props.targetCookingTime
      );
    };
    if (between(0.1, 0.1)) {
      return (
        <>
          <PositiveResult incrementStreak={this.props.incrementStreak} />
        </>
      );
    } else {
      return (
        <p>
          You undercooked the turkey and everyone got ill.
          {this.props.currentTime},{this.props.targetCookingTime}
        </p>
      );
    }
  }
}

export default Result;
